import { Text } from "react-native";

import { Container } from "./styles";

const ChannelList: React.FC = () => {
  const ChannelItem = () => (
    <ChannelContainer>
      <LeftSide>
        <Avatar />
        <Column>
          <Username>alienDev66_official</Username>
          <Info>4.152 news videos</Info>
        </Column>
      </LeftSide>

      <RightSide></RightSide>
    </ChannelContainer>
  );

  return (
    <List>
      <ChannelItem />
    </List>
  );
};

export default ChannelList;
